drop schema Stock_Market;
Create schema Stock_Market;
use Stock_Market;




drop table dim_exchange;
Create table dim_exchange(
exchange_id VARCHAR(10) primary key,
Exchange_Name CHAR(30),
Country CHAR(20),
Currency CHAR(5)

);

Values ("EXCH01","Nse","India","Inr"), ("EXCH02","Nasdaq","Usa","Usd")
;

drop table dim_sector;
create table dim_sector (
Sector_Id varchar(10) primary key,
Sector_Name CHAR(30)
);

Values ("Sec01","Information Technology"), ("Sec02", "Financials"),("Sec03","Healthcare"),("Sec04", "Energy"),("Sec05","Consumer Discretionary")
;

drop table dim_company;
Create table dim_company(
company_id varchar(20) primary key,
Ticker char(20),
Company_Name char(50),
sector_id varchar(20),
exchange_id varchar(20),
foreign key (sector_id) references dim_sector(sector_id),
foreign key (exchange_id) references dim_exchange(exchange_id)
);





drop table dim_trader;
Create table dim_trader(
trader_id varchar(25) primary key,
trader_name char(40),
desk char(20)
);



drop table dim_portfolio;
create table dim_portfolio(
portfolio_id varchar(20) primary key,
portfolio_name varchar(30),
manager char(30)
);






drop table dim_calendar;
Create table dim_calendar (
date date,
calendar_id INT(5) primary key,
year INT(5),
month INT(2),
day INT(2),
is_month_start char(6)
);





drop table fact_daily_prices;
create table fact_daily_prices(
date date,
company_id Varchar(12),
open decimal(6,2),
high decimal(6,2),
low decimal(7,2),
close decimal(7,2),
volume numeric,
calendar_id numeric,
cumulative_factor decimal(2,1),
adjusted_close decimal(16,8),
avg_vol decimal(20,10),
is_volume_suspect char(5),
Daily_return decimal(15,10),	

foreign key (company_id) references dim_company(company_id)

);






drop table fact_dividends;
create table fact_dividends (
date date ,
company_id VARCHAR(10),
dividend_per_share decimal(4,2),
calendar_id INT(5),
exchange_id VARCHAR(10),
is_orphan_dividend CHAR(10),
foreign key (company_id) references dim_company(company_id),
foreign key (exchange_id) references dim_exchange(exchange_id),
foreign key (calendar_id) references dim_calendar(calendar_id) 
);




drop table fact_splits;
create table fact_splits (
company_id VARCHAR(10) ,
date date ,
split_ratio decimal(2,1) ,
calendar_id INT(5),
exchange_id VARCHAR(10) ,
foreign key (company_id) references dim_company(company_id),
foreign key (calendar_id) references dim_calendar(calendar_id),
foreign key (exchange_id) references dim_exchange(exchange_id)
);



drop table fact_orders;
create table fact_orders (
order_id VARCHAR(10) primary key,	
order_ts date ,	
company_id VARCHAR(10),	
side CHAR(10),	
quantity INT(5),	
status CHAR(10),	
order_type CHAR(10),	
trader_id VARCHAR(10),	
portfolio_id VARCHAR(10),	
date date,	
calendar_id	INT(5),
order_ts_imputed CHAR(10),	
limit_price_imputed CHAR(5),	
portfolio_id_imputed CHAR(5),
foreign key (company_id) references dim_company(company_id),
foreign key (trader_id) references dim_trader(trader_id),
foreign key (portfolio_id) references dim_portfolio(portfolio_id),
foreign key (calendar_id) references dim_calendar(calendar_id)
);







drop table fact_trades;
create table fact_trades (
trade_id VARCHAR (20) primary key,
order_id VARCHAR (10),	
trade_ts datetime,	
company_id	VARCHAR(10),
side CHAR(10),
quantity INT(5),
price decimal(8,3),
fees decimal(8,3),
trader_id VARCHAR(20),
portfolio_id VARCHAR(20),	
date date,	
calendar_id	INT(5),
trade_ts_imputed CHAR(5),
fees_imputed CHAR(5),
portfolio_id_imputed CHAR(5),	
is_orphan_trade CHAR(5),	
Trade_volumTrade_volume decimal(11,2) ,
foreign key (order_id) references fact_orders(order_id),
foreign key (company_id) references dim_company(company_id),
foreign key (trader_id) references dim_trader(trader_id),
foreign key (portfolio_id) references dim_portfolio(portfolio_id)

);



DROP table fact_positions_snapshot;
create table fact_positions_snapshot (
portfolio_id VARCHAR(10),	
company_id VARCHAR(10),
date date,
quantity INT(5),
calendar_id INT(5),
foreign key (company_id) references dim_company(company_id),
foreign key (portfolio_id) references dim_portfolio(portfolio_id),
foreign key (calendar_id) references dim_calendar(calendar_id)
);





drop table stocks;
create table stocks (
ticker CHAR(5),
company_name CHAR(30),
exchange CHAR(6),
sector	CHAR(30),
currency CHAR(3),	
share_price	INT(5),
outstanding_shares INT(5),
market_cap INT(10),
quantity INT(5),	
buy_price decimal(12,7),
initial_value decimal(12,6),	
current_price INT(5),	
current_value INT(6),
return_pct decimal(13,9)
);





drop table fact_trades_pnl_kpi;
create table fact_trades_pnl_kpi (
portfolio_id VARCHAR(10),	
company_id VARCHAR(10),
sell_trade_id VARCHAR(15),	
trader_id VARCHAR(10),
sell_date date,
calendar_id	INT(10),
sell_price decimal(6,2),
quantity_sold INT(5),
gross_sell_amount decimal(9,2),
gross_buy_amount decimal(10,2),
allocated_buy_fees	decimal(15,10),
allocated_sell_fees	decimal(6,2),
total_fees_allocated decimal(15,9),	
avg_buy_price decimal(11,7),	
total_cost_basis decimal(15,5),	
realized_profit	decimal(15,8),
return_pct	decimal(11,9),
win_flag INT(1),
foreign key (portfolio_id) references dim_portfolio(portfolio_id),
foreign key (company_id) references dim_company(company_id),
foreign key (sell_trade_id) references fact_trades(trade_id),
foreign key (trader_id) references dim_trader(trader_id),
foreign key (calendar_id) references dim_calendar(calendar_id)

);



